import React, { useState } from 'react';
import '../custom.scss'
import video from '../assets/video_banner.mp4';
import penguin from'../assets/placeholder_penguin.png';
import '../css/Welcome.css';
import '../css/index.css';
import '../css/Modal.css'
import Modal from './Modal';
import Footer from './Footer';
import NavBanner from './NavBanner';

function Welcome() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <>
      <NavBanner />
      <section id='banner'>
        <div id='slideshow'>
          <video autoPlay loop muted> 
            <source type="video/mp4" src={video} />
          </video>
        </div>
      </section>
      <div id='title_outside'>
        <p>RAKUGAKI</p>
        <h1>ラク<br></br>ガキ</h1>
      </div>
      <section id='buttons'>
        <button type="button" class="btn btn-primary" id='button_signin' data-toggle="button" aria-pressed="false" autocomplete="off">
          sign in
        </button>
        <button type="button" class="btn btn-primary" id='button_login' data-toggle="button" aria-pressed="false" autocomplete="off" onClick={() => setIsOpen(true)}>
          log in
        </button>
      </section>
      {isOpen && <Modal closeModal={() => setIsOpen(false)} />}
      <img id="penguin" src={penguin}></img>
      <Footer />
    </>
  );
}

export default Welcome;
